import { render } from "@testing-library/react";
import {GlobalStyle,  Header  } from "./styled";

export function MyHeader(){
    return(
        <div className="App">
            <GlobalStyle />
            <Header>
                <div className="title">
                <h1 >Logo</h1>  
                </div>
                <div className="menu">
                <h1 >Menu</h1>    
                </div >    
            </Header>
        </div>
    );
}
